package assignment;

public class Print14 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int n=17,f=0;
    	for(int i=1;i<=n;i++)
    	{
    		if(n%i==0){
    			f=f+1;
    			}   	
    		}if(f==2)
    		{
    			System.out.println("prime");
    		}
    		else {
    			System.out.println("not a prime");
		}
    	}
}
     
      



    	 
